import { Sorter } from "./sorter";
import ReactStars from "react-rating-stars-component";

export const userColumns = [
  {
    title: "SlNo",
    dataIndex: "id",
    Key: "id"
  },
  {
    title: "Name",
    dataIndex: "name",
    key: "name",
    sorter: {
      compare: Sorter.DEFAULT,
      multiple: 2
    }
  },
  {
    title: "Email",
    dataIndex: "email",
    key: "email",
    sorter: {
      compare: Sorter.DEFAULT,
      multiple: 2
    }
  },
  {
      title: "Ratings",
      key : "ratings",
      render:(record) => {
        const firstExample = {
            size: 40,
            value: 2.5,
            edit: false
          };
        return (<ReactStars {...firstExample} />);
      }
  }

];
